function MainPage() {

  return ( 
    <div>
      <S.Nav>{IconSearch1}Select Idiom/Genre</S.Nav>
      <S.Background><h1>The Hills of Kintail</h1></S.Background>
      </div>
  )

}

export default MainPage;
